    fetch('https://www.fishwatch.gov/api/species')
    .then(resp => resp.json())
    .then(setFish)
    .then(setIsLoaded(true))
  }, [])
 const [isLoaded, setIsLoaded] = useState(false)

 if(!isLoaded){
  return <h1>Loading...</h1>
 }


